import Home from './components/Home';
import AllCategory from './components/AllCategory';




function App() {
  return (

    <Router>
      <div>
        <BasicExample />


        <Route path='/add' exact component={AddCategory} />
        <Route path='/' exact component={AllCategory} />
      </div>
    </Router>




  );
}

export default App;
